import React from 'react';
import {Link} from 'react-router-dom';
import "./styles/ButtonNav.css";


const button = (props) => (
    <div>
       <Link to="${this.props.path}"><button className="butMenu" >{props.name}</button></Link>
    </div>
);

export default button;
